INSERT INTO `quest_template` (`Id`, `Method`, `Level`, `MinLevel`, `ZoneOrSort`, `PrevQuestId`, `NextQuestId`, `NextQuestIdChain`, `Title`, `Objectives`, `Details`, `EndText`, `OfferRewardText`, `RequestItemsText`, `CompletedText`) VALUES
(100000, 2, 1, 1, -284, 0, 100001, 100001, 'Kaer is missing!', 'Talk to Borrean.', 'Greetings $N, our beloved leader has been captured by an unknown demon.$BBorrean was the last one seen with Kaer. Go and talk to him and try to find more infomartion. You will find him at the place where those who must not be fed reside, close to the place where many swords clashed and many corpses layed. You will find him where the sea wolf roams and where the ancient ones dream.', '', 'Hermes has sent you, yes? True, I am the last one who saw Kaer alive but I am afraid I cannot help you further. My memory has been lost. Somebody hit me pretty good. Go and seek Aldtharios. He was always close to us and probably knows where we went.', '', '');
INSERT INTO `creature_queststarter` (`id`, `quest`) VALUES
(500014, 100001);
INSERT INTO `creature_questender` (`id`, `quest`) VALUES
(500015, 100001);
INSERT INTO `quest_template` (`Id`, `Method`, `Level`, `MinLevel`, `ZoneOrSort`, `PrevQuestId`, `NextQuestId`, `NextQuestIdChain`, `Title`, `Objectives`, `Details`, `EndText`, `OfferRewardText`, `RequestItemsText`, `CompletedText`) VALUES
(100001, 2, 1, 1, -284, 100000, 100002, 100002, 'Find Aldtharios', 'Talk to Aldtharios.', 'Aldtharios probably knows a lot more than me currently. He is at the edge of the world, always overlooking The Veiled Sea. You will have to go south, over mountains and endless sea. Warm house, but no people to fill it. Lively farm but no animals to live in it. The windmill always turns, even when there\'s no wind.', '', 'Hmm, I know nothing about Kaer being lost. In fact, I haven\'t seen him since last anniversary. You should speak to his former assistant Arlequina.', '', '');
INSERT INTO `creature_queststarter` (`id`, `quest`) VALUES
(500015, 100002);
INSERT INTO `creature_questender` (`id`, `quest`) VALUES
(500016, 100002);
INSERT INTO `quest_template` (`Id`, `Method`, `Level`, `MinLevel`, `ZoneOrSort`, `PrevQuestId`, `NextQuestId`, `NextQuestIdChain`, `Title`, `Objectives`, `Details`, `EndText`, `OfferRewardText`, `RequestItemsText`, `CompletedText`) VALUES
(100002, 2, 1, 1, -284, 100001, 100003, 100003, 'Find Arlequina', '', 'She stands at where dimensions interwine and rip through the fabric of time and space. One of four through which the Great Beast sent armies of dismay. One of four that were all sealed by the one who is blind.', '', 'Yes, I’m aware of the disaster that happened. You must find Gackt immediately, he will show you the true path.', '', '');
INSERT INTO `creature_queststarter` (`id`, `quest`) VALUES
(500016, 100003);
INSERT INTO `creature_questender` (`id`, `quest`) VALUES
(500017, 100003);
INSERT INTO `quest_template` (`Id`, `Method`, `Level`, `MinLevel`, `ZoneOrSort`, `PrevQuestId`, `NextQuestId`, `NextQuestIdChain`, `Title`, `Objectives`, `Details`, `EndText`, `OfferRewardText`, `RequestItemsText`, `CompletedText`) VALUES
(100003, 2, 1, 1, -284, 100002, 100004, 100004, 'Seek Gackt', 'Talk to Gackt.', 'He can be found where the cold winds blow, where the patron of nature was resurrected, one who died defending the land. In a hollow tree, which roots seep deep into the dwelling of an ancient evil.', '', 'I see, you are here to help. You must move at once, Edifice will tell you what to do.', '', '');
