(100004, 2, 1, 1, -284, 100003, 100005, 100005, 'What of Edifice?', 'Find Edifice.', 'Edifice is somewhere in Borean Tundra. He holds information that we need to obtain. However, he\'s torn between dimensions of Twisting Nether, you\'ll have to decipher his message.', '', 'By just being here I\'m tearing the fabric of time and space… wibbly wobbly timey wimey.', '', '');
